package com.tool.connection.pojo;

public class RequestOrderEntry {

	public RequestOrderEntry() {
		// TODO Auto-generated constructor stub
	}
	
	private String price;
	private String security_id;
	private String entity_id;
	private String order_no;
	/**
	 * @return the price
	 */
	public String getPrice() {
		return price;
	}
	/**
	 * @param price the price to set
	 */
	public void setPrice(String price) {
		this.price = price;
	}
	/**
	 * @return the security_id
	 */
	public String getSecurity_id() {
		return security_id;
	}
	/**
	 * @param security_id the security_id to set
	 */
	public void setSecurity_id(String security_id) {
		this.security_id = security_id;
	}
	/**
	 * @return the entity_id
	 */
	public String getEntity_id() {
		return entity_id;
	}
	/**
	 * @param entity_id the entity_id to set
	 */
	public void setEntity_id(String entity_id) {
		this.entity_id = entity_id;
	}
	/**
	 * @return the order_no
	 */
	public String getOrder_no() {
		return order_no;
	}
	/**
	 * @param order_no the order_no to set
	 */
	public void setOrder_no(String order_no) {
		this.order_no = order_no;
	}
	
	

}
